import React from 'react';
import Layout from './hoc/Layout/Layout';
import {Route , BrowserRouter} from 'react-router-dom';
import Store from './containers/Store/Store';

function App() {
  return (
    <BrowserRouter>
    <div className="App">
      <Layout>
        <Route ref = "/:storeId" component = {Store}/>
      </Layout>
    </div>
    </BrowserRouter>

  );
}

export default App;
